import React from "react";

export class ListItem extends React.Component {
  render() {
    const {
      by,
      descendants,
      id,
      kids,
      score,
      time,
      title,
      type,
      url,
    } = this.props.item;

    console.log(this.props);

    return (
      <div className="Item">
        <div className="mainInfo">
          <div>
            <a
              className="itemTitle"
              href={url}
            >
              {title}
            </a>
            <span className="domain">({url})</span>
          </div>
          <div className="info">
            18 points
            <span className="divider">|</span>
            by fatiherikli
            <span className="divider">|</span>
            July 18, 2016
            <span className="divider">|</span>
            <a
              className="comments"
              href="https://news.ycombinator.com/item?id=12115187"
            ><strong>665</strong> comments</a
            >
          </div>
        </div>
      </div>
    );
  }
}
